   <div>
   <div style={{ color : 'white'}}>;edl,</div>
   <button> <img  src={Logout} className="rounded-circle bg-outline-light logo" alt="Logout"  />  </button>
    <div><Sidebar/></div>
   
</div>

  
  )
}

export default dashboard
